import React from 'react';
import './Modal.css'; // Import the CSS file for modal styles

function Modal({ element, onSaveChanges, onClose }) {
  // Add your modal content and form elements here
  return (
    <div className='modal'>
      {/* Example content */}
      <h2>Edit Label Settings</h2>
      <form onSubmit={(e) => { e.preventDefault(); onSaveChanges({}); }}>
        <label>Text:</label>
        <input type="text" defaultValue={element?.text || ''} />
        <label>X Coordinate:</label>
        <input type="number" defaultValue={element?.x || 0} readOnly />
        <label>Y Coordinate:</label>
        <input type="number" defaultValue={element?.y || 0} readOnly />
        <button type="submit">Save Changes</button>
        <button type="button" onClick={onClose}>Cancel</button>
      </form>
    </div>
  );
}

export default Modal;
